import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Home from './ui/Home';

function App(){
  return (
    <Router>
      <nav style={{padding:10, borderBottom:'1px solid #ddd'}}>
        <Link to="/">Home</Link> | <Link to="/donations">Donations</Link> | <Link to="/recipes">Recipes</Link>
      </nav>
      <Routes>
        <Route path="/" element={<Home/>} />
        <Route path="/donations" element={<div>Donations Page (placeholder)</div>} />
        <Route path="/recipes" element={<div>Recipes Page (placeholder)</div>} />
      </Routes>
    </Router>
  );
}

export default App;
